import React from 'react'
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import { makeStyles } from '@material-ui/core/styles';
import { Button, Typography, ListItemText} from '@material-ui/core';
import SaveIcon from '@material-ui/icons/Save';
import Link from '@material-ui/core/Link';
import API from '..//utils/API';

const useStyles = makeStyles((theme) => ({
    button: {
        margin: theme.spacing(1),
    },
}));

export const ResultList = (props) => {

    function submitBook(event) {
        API.Author.create({ name: props.volumeInfo.authors })

    }
    const preventDefault = (event) => event.preventDefault();
    const classes = useStyles();
    return (
        <div>
            {props.results.length ? (
                <List>
                    {props.results.map(result => (

                        <ListItem key={result.id}>
                            {/* <Image src= {result.volumeInfo.imageLinks.thumbnail}> 
                            </Image> */}
                            <ListItemText
                                primary={
                                    <React.Fragment>
                                        <img src={result.volumeInfo.imageLinks.thumbnail}></img>
                                        <Typography variant="h5">
                                        <Link href={result.selfLink}>

                                            {result.volumeInfo.title}
                                            </Link>
                                            <Button
                                                variant="outlined"
                                                color="primary"
                                                size="small"
                                                className={classes.button}
                                                startIcon={<SaveIcon />}
                                                onClick={submitBook()}
                                            >
                                                SAVE
                                            </Button>
                                        </Typography>
                                    </React.Fragment>
                                }
                                secondary={
                                    <React.Fragment>
                                        <Typography
                                            variant="h6"
                                        >
                                            {result.volumeInfo.authors}, published {result.volumeInfo.publishedDate}
                                        </Typography>
                                        <Typography variant="caption">

                                            {result.volumeInfo.description}
                                        </Typography>
                                    </React.Fragment>
                                }
                            />
                        </ListItem>
                    ))}
                </List>
            ) : (
                    <h3>No Results to Display</h3>
                )}
        </div>
    )
}
